package main

import (
	"encoding/base64"
	"io/ioutil"
	"log"
)

func main() {
	b := ``

	d, err := base64.StdEncoding.DecodeString(b)
	if err != nil {
		log.Fatalf("base64 decode string error:%v", err)
	}
	if err := ioutil.WriteFile("1.silk", d, 0600); err != nil {
		log.Fatalf("write silk file error:%v", err)
	}
}
